if mibBuilder.loadTexts: cvaIfEMCfgSignalType.setStatus('current')
if mibBuilder.loadTexts: cvaIfEMCfgSignalType.setDescription("The signaling type of E&M tie trunk interface. winkStart - the calling side seizes the line by going off-hook on its E lead but waits for a short off-hook 'wink' indication on its M lead from the called side before sending address information as DTMF digits. immediateDial - the calling side seizes the line by going off-hook on its E lead and sends sends address information as DTMF digits. delayDial - the calling side seizes the line by going off-hook on its E lead. After a timing interval, the calling side looks at the supervision from the called side. If the supervision is on-hook, the calling side starts sending information as DTMF digits; otherwise, the calling side waits until the called side goes on-hook and then starts sending address information. lmr - the e&m port is used to interface with Land Mobil Radio system. The e-lead and m-lead are not used in the traditional way. fgd - Feature Group D is an access switched services that provides access to Local Exchange Carrier of the public switched network. It is supported in North America only based on E&M wink-start. fgd-eana - Exchange Access North American signalling protocol of Feature Group D. ")
